@babar 🌻 

Does encouragement help athletes train harder? In the Unit 4 Review Exercises, you read about an experiment that attempted to answer this question. In the experiment, Coach Peace randomly assigned 24 of his players to an “encouragement group” and the remaining 23 players to a control group that didn’t receive extra encouragement. While one group waited outside the gym, the other group participated in a push-up contest in which the players did push-ups until exhausted. Both groups were given the exact same instructions about how to perform the push-ups as the coach counted out loud instructions about how to perform the push-ups as the coach counted out loud (“1 . . . 2 . . . 3 . . .”), but the encouragement group was instructed to shout “Win!” between each push-up. The other group did not receive any additional instructions.

If there is convincing evidence that the players in the encouragement group had a greater ABILITY to do push-ups, should you conclude that shouting “Win!” between the push-ups was the cause of the increased ABILITY?
